def step7():
	a = 0
	ret = ''
	f = open('output6', 'r').read()
	for index, val in enumerate(f):
		if val == '\n':
			continue
		if val == 'n':
			a -= 1
		if val == 'y':
			a += 1
		if val == 'a':
			ret += chr(a)
		if val == '~':
			a = 0
	return bin(int(ret))[2:]

